        // 27. Remove Element
        // https://leetcode.com/problems/remove-element/description/?envType=study-plan-v2&envId=top-interview-150
        public static int RemoveElement(int[] nums, int val)
        {
            int result = 0;
            foreach (var item in nums)
            {
                if (item != val)
                {
                    nums[result] = item;
                    result++;
                }
            }

            return result;
        }


